          "data": "Il vise à rendre l'utilisateur intéressé à contrôler le développement de plusieurs lignes (2-5, moins souvent 8-10) de leur structure. Celles. l'utilisateur contrôle s'il est invité au projet et si les paiements sont contrôlés par son invité personnel, ainsi que par les utilisateurs des lignes les plus proches. Il est facturé à partir des paiements des utilisateurs debout sur 2 à 5 lignes, en règle générale - de 8% à 2%. Dans le plan marketing actuel - 7 % à partir d'une profondeur de 5 niveaux (pour chaque niveau), la valeur totale est de 35 %"
