    "page": "/admin/marketing/settings",
    "group": "common",
    "data": {
      "_id": {
        "$oid": "61d5e7b7aabd347ae2984a8c"
      },
      "default": "Направлен на то, чтобы заинтересовать пользователя в ведении контроля за развитием нескольких линий (2-5, реже 8-10) своей структуры. Т.е. пользователь контролирует, приглашают ли в проект и контролируют ли проведение оплат  его лично-приглашенные, а также пользователи ближайших линий. Начисляется с оплат пользователей, стоящих во 2-5 линиях, как правило - от 8% до 2%. В текущем маркетинг-плане - 7% с глубины в 5 уровней (за каждый уровень), общее значение - 35%",
      "textName": "adminMarketingSettings-3-bonuses-text-2",
      "trans": {
        "zh": {
          "data": "它旨在使用户对控制其结构的几行（2-5，较少为 8-10）的开发感兴趣。那些。用户控制他是否被邀请到该项目以及付款是否由他个人邀请以及最近线路的用户控制。通常从 2-5 行用户的付款中收取 - 从 8% 到 2%。在当前的营销计划中 - 7% 来自 5 个级别的深度（每个级别），总值为 35%"
        },
        "fr": {
          "data": "Il vise à rendre l'utilisateur intéressé à contrôler le développement de plusieurs lignes (2-5, moins souvent 8-10) de leur structure. Celles. l'utilisateur contrôle s'il est invité au projet et si les paiements sont contrôlés par son invité personnel, ainsi que par les utilisateurs des lignes les plus proches. Il est facturé à partir des paiements des utilisateurs debout sur 2 à 5 lignes, en règle générale - de 8% à 2%. Dans le plan marketing actuel - 7 % à partir d'une profondeur de 5 niveaux (pour chaque niveau), la valeur totale est de 35 %"
        }
      }
    },
