    "page": "/admin/marketing/settings",
    "group": "common",
    "data": {
      "_id": {
        "$oid": "61d5e7b7aabd347ae2984aae"
      },
      "default": "Направлен на выполнение группового объема структуры пользователя не менее определенного значения, частично - на развитие структуры в ширину. Начисляется в виде процента от объема личной группы (ОЛГ) - полностью, от объемов структур пользователей с рангами (квалифицированными пользователями) -  частично. При этом один и тот же процент не может быть начислен на один и тот же объем несколько раз",
      "textName": "adminMarketingSettings-2-bonuses-text-3",
      "trans": {
        "zh": {
          "data": "它旨在满足不小于一定值的用户结构的组体积，部分地 - 在宽度上开发结构。它按个人组 (PGL) 数量的百分比收费 - 全部是具有等级的用户结构（合格用户）的数量 - 部分。同时，同一交易量不能多次累积相同的利息。"
        },
        "fr": {
          "data": "Il vise à remplir le volume de groupe de la structure d'utilisateurs pas moins d'une certaine valeur, en partie - à développer la structure en largeur. Elle est facturée en pourcentage du volume d'un groupe personnel (PGL) - en totalité, du volume des structures d'utilisateurs avec rangs (utilisateurs qualifiés) - en partie. Dans le même temps, le même intérêt ne peut pas être cumulé plusieurs fois sur le même volume."
        }
      }
    },
