    "page": "/admin/marketing/settings",
    "group": "common",
    "data": {
      "_id": {
        "$oid": "61d5e7b7aabd347ae2984ac4"
      },
      "default": "Направлен на выполнение группового объема структуры пользователя не менее определенного значения, частично - на развитие структуры в ширину. Начисляется в виде процента от объема личной группы (ОЛГ) - полностью, от объемов структур пользователей с рангами (квалифицированными пользователями) - частично. При этом один и тот же процент не может быть начислен на один и тот же объем несколько раз.",
      "textName": "adminMarketingSettings-3-bonuses-text-3",
      "trans": {
        "zh": {
          "data": "它的目的是使用户结构的组体积不小于某个值，部分是为了在宽度上开发结构。它按个人组 (PGL) 数量的百分比收费 - 全部是具有等级的用户结构（合格用户）的数量 - 部分。同时，不能对同一数量多次收取相同的利息。"
        },
        "fr": {
          "data": "Il vise à remplir le volume de groupe de la structure d'utilisateurs pas moins d'une certaine valeur, en partie - à développer la structure en largeur. Elle est facturée en pourcentage du volume d'un groupe personnel (PGL) - en totalité, du volume des structures d'utilisateurs avec rangs (utilisateurs qualifiés) - en partie. Dans le même temps, le même intérêt ne peut pas être imputé plusieurs fois sur le même volume."
        }
      }
    },
    "__v": 0
