    "group": "common",
    "data": {
      "_id": {
        "$oid": "61d683fae5e0f98801a227d6"
      },
      "default": "Вы можете настроить поиск по отправителю и получателю, используя логические операции \"и\" или \"или\". Если выбран вариант \"И\", то поиск будет искать совпадения согласно указанным значениям в поле \"Отправитель\" и \"Получатель\". Если выбран вариант \"Или\", то поиск покажет все результаты, которые подходят по по указанным значениям или в поле \"Отправитель\", или в поле \"Получатель\"",
      "textName": "getFormData-search_type-hint",
      "trans": {
        "zh": {
          "data": "您可以使用逻辑运算“和”或“或”按发件人和收件人进行搜索。如果选择“AND”，则搜索将根据“Sender”和“Recipient”字段中的指定值搜索匹配项。如果选择“或”选项，则搜索将显示与“发件人”字段或“收件人”字段中的指定值匹配的所有结果"
        },
        "fr": {
          "data": "Vous pouvez rechercher par expéditeur et destinataire en utilisant les opérations logiques \"et\" ou \"ou\". Si \"ET\" est sélectionné, la recherche recherchera les correspondances en fonction des valeurs spécifiées dans les champs \"Expéditeur\" et \"Destinataire\". Si l'option \"Ou\" est sélectionnée, la recherche affichera tous les résultats qui correspondent aux valeurs spécifiées soit dans le champ \"Expéditeur\", soit dans le champ \"Destinataire\""
        }
      }
    },
