      "default": "Чем дольше время ожидания транзакции, тем больше временных кошельков Вам может понадобиться для приёма оплат от пользователей.  Обращаем внимание, что для создания каждого временного кошелька с Вашего кошелька для комиссии будет списываться 1.1 TRX.",
