      "_id": {
        "$oid": "61d98a41e281d3b5c830584d"
      },
      "default": "Реферальный (уровневый) бонус - начисляется по структуре личных приглашений. Направлен на то, чтобы заинтересовать пользователя в контроле за развитием нескольких (2-5, реже 8-10) линий своей структуры. Т.е. пользователь контролирует, приглашают ли в проект и контролируют ли проведение оплат  его лично-приглашенные, а также пользователи ближайших линий. Начисляется с оплат пользователей, стоящих во 2-5 линиях, как правило - от 8% до 2%",
      "textName": "adminMarketingBonuses-structure_type_title0",
      "trans": {
        "zh": {
          "data": "推荐（级别）奖金 - 根据个人邀请的结构累积。它旨在使用户对控制其结构的几行（2-5，较少为 8-10）的开发感兴趣。那些。用户控制他是否被邀请到该项目以及付款是否由他个人邀请以及最近线路的用户控制。通常从 2-5 行用户的付款中收取 - 从 8% 到 2%"
        },
        "fr": {
          "data": "Bonus de parrainage (niveau) - cumulé en fonction de la structure des invitations personnelles. Il vise à rendre l'utilisateur intéressé à contrôler le développement de plusieurs (2-5, moins souvent 8-10) lignes de sa structure. Celles. l'utilisateur contrôle s'il est invité au projet et si les paiements sont contrôlés par son invité personnel, ainsi que par les utilisateurs des lignes les plus proches. Il est facturé à partir des paiements des utilisateurs debout sur 2 à 5 lignes, en règle générale - de 8% à 2%"
        }
      }
